"use strict";
class odin {
  constructor(base, user, unusedUserAction) {
    this.base = base;
    this.internal = {};
    var internal = this.internal;
    internal.dt = 0.01;
    this.setUser(user, unusedUserAction);
  }
  initial(step) {
    var internal = this.internal;
    var state = Array(2).fill(0);
    state[0] = internal.initial_N_det;
    state[1] = internal.initial_N_stoch;
    return state;
  }
  setUser(user, unusedUserAction) {
    this.base.user.checkUser(user, ["N_init", "r"], unusedUserAction);
    var internal = this.internal;
    this.base.user.setUserScalar(user, "N_init", internal, 1, -Infinity, Infinity, false);
    this.base.user.setUserScalar(user, "r", internal, 0.10000000000000001, -Infinity, Infinity, false);
    internal.initial_N_det = internal.N_init;
    internal.initial_N_stoch = internal.N_init;
  }
  getInternal() {
    return this.internal;
  }
  update(step, state, state_next, random) {
    var internal = this.internal;
    const N_stoch = state[1];
    var n_birth = random.binomial(this.base.maths.round2(N_stoch), internal.r * internal.dt);
    var time = step * internal.dt;
    state_next[0] = internal.N_init * Math.exp(internal.r * time);
    state_next[1] = N_stoch + n_birth;
  }
  info() {
    const ret = [];
    const internal = this.internal;
    ret.push({ dim: [], length: 1, name: "N_det"});
    ret.push({ dim: [], length: 1, name: "N_stoch"});
    return ret;
  }
  size() {
    const internal = this.internal;
    return 2;
  }
}
odin;
